import React, { Component } from 'react';
import Home from './home'
class App extends Component {
  constructor(props){
    super(props)
    this.state={
      open: false
    }
  }

  AddCrads=()=>{
    this.setState({open: true})
  }
  render() {
    return (
      <div className="App">
        <Home AddCrads={this.AddCrads}/>
      </div>
    );
  }
}

export default App;
